description_full:
Find out how to run effective A/B tests that increase a website's profitability with my online training course, 'Learn to A/B test like a professional'. 

From planning and preparation, through to implementing experiments and understanding the results, I take you through the entire A/B testing process, including:

Setting a baseline and goals;
Gathering insights;
What the different types of experiment are;
What you should do before, during and after running an A/B test, and 
Documenting your experiments.

You can enrol for the course at https://www.udemy.com/course/learn-to-ab-test-like-a-professional

In this video we'll discuss the Tableau Forecasting options. We'll learn how to evaluate the quality of Tableau's predictive model. And we'll also learn how to compare Tableau's forecast vs. your actual data..

